import React from 'react';
import { Table, Tag, Space } from 'antd';

const columns = [
  {
    title: 'ተ.ቁ',
    dataIndex: 'id',
    key: 'id',
    // render: text => <a>{text}</a>,
  },
  {
    title: 'ምርጫው የተካሄደበት ክልል/ከተማ መስተዳድር',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'የተመዘገቡ መራጮች ቁጥር',
    dataIndex: 'address',
    key: 'address',
  },

  {
    title: 'ከተመዘገቡ መራጮች መካከል ድምፅ የሰጡ በመቶኛ',
    key: 'tags',
    dataIndex: 'tags',
    render: tags => (
      <>
        {tags.map(tag => {
          let color = tag.length > 5 ? 'geekblue' : 'green';
          if (tag === 'loser') {
            color = 'volcano';
          }
          return (
            <Tag color={color} key={tag}>
              {tag.toUpperCase()}
            </Tag>
          );
        })}
      </>
    ),
  },  
  {
    title: 'ክልሉ ያለው የተወካዮች ምክር ቤት መቀመጫ ብዛት',
    dataIndex: 'address',
    key: 'address',
  },
  {
      title: 'ክልሉ ያለው የክልል ምክር ቤት መቀመጫ ብዛት', 
      dataIndex: 'address',
      key: 'address'
  },
  {
    title: 'መስከረም 20 ቀን ምርጫ የተከናወነበት የተወካዮች ምክር ቤት ምርጫ ክልል ብዛት', 
    dataIndex: 'address',
    key: 'address'
},
{
    title: 'ለተወካዮች ምክር ቤት መቀመጫ ያገኙ ፓርቲዎች እና የመቀመጫ ቁጥር', 
    dataIndex: 'address',
    key: 'address'
},
{
    title: 'ድጋሚ ቆጠራ የሚከናወንበት ምርጫ ክልል ብዛት',
    dataIndex: 'address',
    key: 'address'
},
{
    title: 'ድጋሚ ምርጫ የሚከናወንበት ምርጫ ክልል ብዛት',
    dataIndex: 'address',
    key: 'address'
},
{
    title: 'መስከረም 20 ቀን ምርጫ የተከናወነበት የክልል ምክር ቤት ምርጫ ክልል ብዛት',
    dataIndex: 'address',
    key: 'address'
},
{
    title: 'በሁለቱም ምርጫ አይነቶች ምርመራ ላይ ያሉ ምርጫ ክልሎች ብዛት',
    dataIndex: 'address',
    key: 'address'
},
];

const data = [
  {
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    name: 'Jim Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    name: 'Joe Black',
    age: 32,
    address: 'Sidney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];
const language = [
    { "ተ.ቁ": "", "ምርጫው የተካሄደበት ክልል/ከተማ መስተዳድር": "", "የተመዘገቡ መራጮች ቁጥር": "", "ከተመዘገቡ መራጮች መካከል ድምፅ የሰጡ በመቶኛ": "", "ክልሉ ያለው የተወካዮች ምክር ቤት መቀመጫ ብዛት": "", "ክልሉ ያለው የክልል ምክር ቤት መቀመጫ ብዛት": "", "መስከረም 20 ቀን ምርጫ የተከናወነበት የተወካዮች ምክር ቤት ምርጫ ክልል ብዛት": "", "ለተወካዮች ምክር ቤት መቀመጫ ያገኙ ፓርቲዎች እና የመቀመጫ ቁጥር": "", "ድጋሚ ቆጠራ የሚከናወንበት ምርጫ ክልል ብዛት": "", "ድጋሚ ምርጫ የሚከናወንበት ምርጫ ክልል ብዛት": "", "መስከረም 20 ቀን ምርጫ የተከናወነበት የክልል ምክር ቤት ምርጫ ክልል ብዛት": "", "ለክልል ምክር ቤት መቀመጫ ያገኙ ፓርቲዎች እና የመቀመጫ ቁጥር": "", "ድጋሚ ቆጠራ የሚከናወንበት ምርጫ ክልል ብዛት": "", "ድጋሚ ምርጫ የሚከናወንበት ምርጫ ክልል ብዛት": "", "በሁለቱም ምርጫ አይነቶች ምርመራ ላይ ያሉ ምርጫ ክልሎች ብዛት": "" },
  ]

export default function ResultTable() {
  return (
  <div style={{marginTop: '5%'}}>
      <Table size='larg' columns={columns} dataSource={data} />
  </div>
  );
}
